   "source": [
    "# Standard Deviation of AQI\n",
    "\n",
    "* Standard Deviation, which measures variability, in the recent years is about 13.5 for Delhi and about 10 for Greater Noida.\n",
    "* Standard Deviation was higher in 2020 and 2021 because of low AQI on many days because of Covid lockdowns.\n",
    "* Until 2021, AQI for Greater Noida had higher Standard Deviation than for Delhi. This has reversed in the recent years.\n",
    "  "
   ]
  },
