   "source": [
    "* The correlation coefficient of AQI between Delhi and Greater Noida is 0.936, which is very high.\n",
    "* The correlation is highly significant.\n",
    "* This confirms that the causes of air pollution are common between Delhi and Greater Noida."
   ]
