   "source": [
    "# Raw data on air pollutants from Anand Vihar and Greater Noida Knowledge Park V stations\n",
    "\n",
    "* Anand Vihar is the most polluted area of Delhi. \n",
    "* Of all the air pollution measurement stations, Greater Noida Knowledge Park V (GNKP-V) is nearest to the Shiv Nadar University.\n",
    "* I have, therefore, selected these two stations for a detailed study of air pollution.\n"
   ]
  },
