   "source": [
    "# Time trends of major pollutants\n",
    "\n",
    "* The graph below shows that PM2.5 and PM10 follow broadly similar time trends in both Anand Vihar and GNKP-V\n",
    "* PM2.5, PM10 and Nitrogen Oxides (NOx) have strong seasonal variations.\n",
    "* On the other hand, Carbon Monoxide (CO), Methane (CH4) and Sulphur Dioxide (SO2) do not exhibit similar seasonal variation.\n",
    "* NOx also followed a similar pattern as PM2.5 and PM10 in the early years captured by these data. However, in more recent years, pattern of variability of NO2 seems different.\n",
    "* We will analyse these in more detail using correlation analysis."
   ]
  },
