   "source": [
    "rawair <- fread(\"/kaggle/input/raw-air-quality-data/rawairquality.csv\")\n",
    "\n",
    "names(rawair) <- c('Date', 'PM2.5', 'PM10', 'NO', 'NO2', 'NOx', 'NH3',\n",
    "                    'SO2', 'CO', 'Ozone', 'Benzene', 'Toluene', 'Xylene',\n",
    "                    'O_Xylene', 'Eth-Benzene', 'MP-Xylene', 'AT', 'RH',\n",
    "                    'WS', 'WD', 'RF', 'TOT-RF', 'SR', 'BP', 'VWS',\n",
    "                    'Station', 'Year')\n",
    "t <- rawair[Date > \"2018-10-01\",\n",
    "         .(PM2.5 = mean(PM2.5, na.rm=TRUE),\n",
    "           PM10 = mean(PM10, na.rm=TRUE),\n",
    "           SO2 = mean(SO2, na.rm=TRUE),\n",
    "           NOx = mean(NOx, na.rm=TRUE),\n",
    "           CO = mean(CO, na.rm=TRUE),\n",
    "           NH3 = mean(NH3, na.rm=TRUE)\n",
    "          ),\n",
    "         .(Station,\n",
    "           Date=as.Date(paste0(year(Date), \"-\",\n",
    "                               month(Date), \"-15\"\n",
    "                      )))]\n",
    "t <- melt(t, id = c(\"Date\", \"Station\"))\n",
    "ggplot(t, aes(x = Date, y=value, colour = variable, group = variable)) +\n",
    "       geom_line(linewidth=1.2) +\n",
    "       facet_wrap(~Station, nrow = 2) +\n",
    "       scale_x_date(\"Month\") + \n",
    "       scale_colour_discrete(\"\") + \n",
    "       scale_y_continuous(\"\") +\n",
    "       theme_bw() + theme(text=element_text(size=30))"
   ]
  },
